import './App.css';
import React, { useState } from 'react';
import Form from './components/form';
import TodoList from './components/TodoList';
function App() {

  const [inputText, setInputText] = useState("");

  return (
    <div className="App">
      <header>
        <h1>MY TODO LIST</h1>
      </header>
      <Form
        inputText={inputText}
        setInputText={setInputText}
      />
      <TodoList />
    </div>
  );
}

export default App;
